const historytableList = () => {
	return (
		<div className="list_table mt-2">
			<table className="text-center" style={{width:'100%'}}>
			  <tr>
			    <th>თარიღი</th>
			    <th>ღირებული</th>
			    <th>რა X</th>
			    <th>რაოდენობა</th>
			    <th>მონაწილეები</th>
			    <th>ადგილები</th>
			    <th>მოგებული</th>
			  </tr>
			  
			</table>			
		</div>
	)
}

export {historytableList}
